🎮 BARCODE BATTLERS II 時空を超えた戦士たち (Warriors who travelled in time)
.
Barcode Battlers was a series of Handheld consoles made by Epoch.
.
Barcode scanning toys and arcade games were extremely popular in the 90's Japan including the Datach Famicom add on, the later Digivices and Barcode Wars by Bandai. The strength of the Barcode Wars series was its connection to nintendo, allowing them to make exclusive barcode games with nintendo franchise such as Mario Bros and Zelda.
.
It also allowed players connect to their Super Famicom or original Gameboy via the 'Barcode Boy' to send data from the barcode cards into the Barcode Battler console games.
.
Barcode Battler was highly successful in Japan and even saw a release of western versions with alternative art and characters.
.
